109 minuten

geregisseerd door Martin McDonagh
met Colin Farrell, Sam Rockwell en Woody Harrelson

Een scenarioschrijver worstelt met zijn script genaamd Seven Psychopaths (Zeven Psychopaten). Maar dan wordt hij door zijn vrienden (Sam Rockwell en Christopher Walken) meegetrokken in een hondenontvoeringszaak. Wanneer de geliefde Shih Tzu van een psychopathische gangster (Woody Harrelson) vermist raakt, vindt de scenarist meer dan genoeg inspiratie voor zijn scenario, op voorwaarde dat hij lang genoeg in leven kan blijven om alles op te schrijven.



